import styled from 'styled-components';

const title = styled.header`
    background-color: gray;
`

const menuBtn = styled.button`
    background-color: gray;
`

export const Header = () => {
    return (
        <title>
            <div>
                <img src='src/image/logo.png' />
                <span>
                    COZ Shopping
                </span>
            </div>
            <button>
                <img src='src/image/햄버거 버튼.png' />
            </button>
        </title>
    )
}

export default Header
